  false,\n\t\"url\": null,\n\t\"notes\": \"The geospatial data represents priorty
  areas for land aquistion within the existing approved aquistion boundary for Dahomey
  National Wildlife Refuge based on potential areas which may contain the endangered
  plant pondberry.  This shapefile was created by clipping National Wetlands Inventory
  (NWI) GIS data (acquired at: https://www.fws.gov/wetlands/) and selecting all forested
  wetland types within this clipped area. Because pondberry is found within forested
  wetlands, this NWI data represents priority areas for pondberry with two caveats:
  1) areas need to be currently forested and 2) areas need to be subject to regular
  seasonal (ideally winter) standing water (either from ponding due to rain or low-energy
  overbank flooding). Basically, consider the NWI shapefile to be a \"first-pass\"
  at prioritizing areas, which should be followed up by examination of current aerial
  imagery and site visits to finalize future prioritization.\",\n\t\"license_title\":
